import React, { useState } from 'react';
import './App.css';

const App = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    id: '',
    password: '',
    passwordRe: '',
    phoneNumber: '',
    birthday: '',
    gender: '',
    address: {
      zipCode: '',
      mainAddress: '',
      detailAddress: '',
    },
  });

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name.includes('address.')) {
      const addressKeys = name.split('.');
      setFormData((prevFormData) => ({
        ...prevFormData,
        address: {
          ...prevFormData.address,
          [addressKeys[1]]: value,
        },
      }));
    } else {
      setFormData({
        ...formData,
        [name]: value,
      });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('회원가입 폼 데이터:', formData);
    // send data
  };

  const handleGoBack = () => {
    // ssend data
    console.log('Go Back 버튼이 클릭되었습니다.');
  };

  return (
    <div className="app-container">
      <h1>JOIN</h1>
      <form onSubmit={handleSubmit}>
        <table>
        <tbody>
            <tr>
              <th>NAME</th>
              <td>
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>E-MAIL</th>
              <td>
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>ID</th>
              <td>
                <input
                  type="text"
                  name="id"
                  value={formData.id}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>PASSWORD</th>
              <td>
                <input
                  type="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>PASSWORD RE</th>
              <td>
                <input
                  type="password"
                  name="passwordRe"
                  value={formData.passwordRe}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>PHONE NUMBER</th>
              <td>
                <input
                  type="tel"
                  name="phoneNumber"
                  value={formData.phoneNumber}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>BIRTHDAY</th>
              <td>
                <input
                  type="text"
                  name="birthday"
                  value={formData.birthday}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th>GENDER</th>
              <td>
                <select
                  name="gender"
                  value={formData.gender}
                  onChange={handleChange}
                >
                  <option value="">SELECT</option>
                  <option value="male">M</option>
                  <option value="female">F</option>
                </select>
              </td>
            </tr>
            <tr>
              <th>ADDRESS</th>
              <td>
                <input
                  type="text"
                  name="address.zipCode"
                  placeholder="POSTAL CODE"
                  value={formData.address.zipCode}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th></th>
              <td>
                <input
                  type="text"
                  name="address.mainAddress"
                  placeholder="주소"
                  value={formData.address.mainAddress}
                  onChange={handleChange}
                />
              </td>
            </tr>
            <tr>
              <th></th>
              <td>
                <input
                  type="text"
                  name="address.detailAddress"
                  placeholder="상세 주소"
                  value={formData.address.detailAddress}
                  onChange={handleChange}
                />
              </td>
            </tr>
          </tbody>
        </table>
        <button type="submit">JOIN</button>
        <button type="button" onClick={handleGoBack}>Go Back</button>
      </form>
    </div>
  );
};

export default App;
